import Home from './VIEWS/HOME/home';
import Landing from './VIEWS/LANDING/landing';
import { Route } from 'react-router-dom';
function App() {
  return (
  <div className="App">
    <Route exact path='/' component={Landing}></Route>
    <Route path='/home'><Home/></Route>
    <Route path='/'><Form/></Route>
  </div>
  );
}

export default App;
